import React, { useState } from 'react';
import { Search } from 'lucide-react';

const Navbar = () => {
    const [zipCode, setZipCode] = useState('');

    const handleZipCodeSubmit = (e) => {
        e.preventDefault();
        // Placeholder for zip code search functionality
        console.log('Searching for district with zip code:', zipCode);
    };

    return (
        <nav className="bg-blue-600 text-white shadow-lg">
            <div className="max-w-7xl mx-auto px-4">
                <div className="flex justify-between items-center h-16">
                    {/* Left side - Logo/Website Name */}
                    <div className="flex items-center">
                        <span className="text-xl font-bold">Find Your Vote NJ</span>
                    </div>

                    {/* Middle - Navigation Links */}
                    <div className="hidden md:flex items-center space-x-4">
                        <button className="px-4 py-2 rounded-md text-sm font-medium hover:bg-blue-700 transition">
                            Home
                        </button>
                        <button className="px-4 py-2 rounded-md text-sm font-medium hover:bg-blue-700 transition">
                            About
                        </button>
                    </div>

                    {/* Right side - Zip Code Search */}
                    <div className="flex items-center">
                        <form onSubmit={handleZipCodeSubmit} className="flex items-center">
                            <div className="relative">
                                <input
                                    type="text"
                                    placeholder="Enter your zip code to find your district"
                                    className="pl-3 pr-10 py-2 rounded-lg text-gray-900 placeholder-gray-500 bg-white focus:outline-none focus:ring-2 focus:ring-blue-400 w-64"
                                    value={zipCode}
                                    onChange={(e) => setZipCode(e.target.value)}
                                    pattern="[0-9]{5}"
                                    maxLength="5"
                                />
                                <button
                                    type="submit"
                                    className="absolute right-2 top-1/2 transform -translate-y-1/2 text-gray-400 hover:text-gray-600"
                                >
                                    <Search size={20} />
                                </button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
